    try {
      const response = await fetch(url);
      const data = await response.json();

      console.log(data.message);
    } catch (error) {
      console.error("Error fetching craftables data: ", error);
    }
    

  };




  return (
    <div className="??">
      <h1>CRAFTING PROFITS GO HERE</h1>

      

